Executes the provided function `fn` and after it is executed, cleans up all
intermediate tensors allocated by `fn` except those returned by `fn`.
`f` must not return a Promise (async functions not allowed).
The returned result can be a complex object, however tidy only walks the
top-level properties (depth 1) of that object to search for tensors, or
lists of tensors that need to be tracked in the parent scope.

Using this method helps avoid memory leaks. In general, wrap calls to
operations in `tidy` for automatic memory cleanup.

When in safe mode, you must enclose all `Tensor` creation and ops
inside a `tidy` to prevent memory leaks.

```js
// y = 2 ^ 2 + 1
const y = tf.tidy(() => {
   // a, b, and one will be cleaned up when the tidy ends.
   const one = tf.scalar(1);
   const a = tf.scalar(2);
   const b = a.square();

   console.log('numTensors (in tidy): ' + tf.memory().numTensors);

   // The value returned inside the tidy function will return
   // through the tidy, in this case to the variable y.
   return b.add(one);
});

console.log('numTensors (outside tidy): ' + tf.memory().numTensors);
y.print();
```

Keeps a `Tensor` generated inside a `tidy` from being disposed
automatically.

```js
let b;
const y = tf.tidy(() => {
   const one = tf.scalar(1);
   const a = tf.scalar(2);

   // b will not be cleaned up by the tidy. a and one will be cleaned up
   // when the tidy ends.
   b = tf.keep(a.square());

   console.log('numTensors (in tidy): ' + tf.memory().numTensors);

   // The value returned inside the tidy function will return
   // through the tidy, in this case to the variable y.
   return b.add(one);
});

console.log('numTensors (outside tidy): ' + tf.memory().numTensors);
console.log('y:');
y.print();
console.log('b:');
b.print();
```

Executes the provided function `f()` and returns a promise that resolves
with information about the function's memory use:
- `newBytes`: tne number of new bytes allocated
- `newTensors`: the number of new tensors created
- `peakBytes`: the peak number of bytes allocated
- `kernels`: an array of objects for each kernel involved that reports
their input and output shapes, number of bytes used, and number of new
tensors created.

```js
const profile = await tf.profile(() => {
   const x = tf.tensor1d([1, 2, 3]);
   let x2 = x.square();
   x2.dispose();
   x2 = x.square();
   x2.dispose();
   return x;
});

console.log(`newBytes: ${profile.newBytes}`);
console.log(`newTensors: ${profile.newTensors}`);
console.log(`byte usage over all kernels: ${profile.kernels.map(k =>
k.totalBytesSnapshot)}`);
```

Provided `f(x)`, returns another function `g(x, dy?)`, which gives the
gradient of `f(x)` with respect to `x`.

If `dy` is provided, the gradient of `f(x).mul(dy).sum()` with respect to
`x` is computed instead. `f(x)` must take a single tensor `x` and return a
single tensor `y`. If `f()` takes multiple inputs, use `grads` instead.

```js
// f(x) = x ^ 2
const f = x => x.square();
// f'(x) = 2x
const g = tf.grad(f);

const x = tf.tensor1d([2, 3]);
g(x).print();
```

```js
// f(x) = x ^ 3
const f = x => x.pow(tf.scalar(3, 'int32'));
// f'(x) = 3x ^ 2
const g = tf.grad(f);
// f''(x) = 6x
const gg = tf.grad(g);

const x = tf.tensor1d([2, 3]);
gg(x).print();
```

Provided `f(x1, x2,...)`, returns another function `g([x1, x2,...], dy?)`,
which gives an array of gradients of `f()` with respect to each input
[`x1`,`x2`,...].

If `dy` is passed when calling `g()`, the gradient of
`f(x1,...).mul(dy).sum()` with respect to each input is computed instead.
The provided `f` must take one or more tensors and return a single tensor
`y`. If `f()` takes a single input, we recommend using `grad` instead.

```js
// f(a, b) = a * b
const f = (a, b) => a.mul(b);
// df / da = b, df / db = a
const g = tf.grads(f);

const a = tf.tensor1d([2, 3]);
const b = tf.tensor1d([-2, -3]);
const [da, db] = g([a, b]);
console.log('da');
da.print();
console.log('db');
db.print();
```

